<!DOCTYPE html>
<html lang="en">
  <head>
    <meta charset="utf-8" />
    <meta name="viewport" content="width=device-width,initial-scale=1" />
    <meta http-equiv="Content-Security-Policy" content="upgrade-insecure-requests">
    <title>Sandbox - CodeSandbox</title>
    <link rel="manifest" href="/manifest.json" />
    <link rel="shortcut icon" href="/favicon.ico" />
    <link rel="mask-icon" href="/csb-ios.svg" color="#fff" />
    <script>
      if ("serviceWorker" in navigator) {
        navigator.serviceWorker
          .register("/npm1.service-worker.js")
          .then(function (registration) {
            console.log("Service Worker 注册成功:", registration);
          })
          .catch(function (error) {
            console.log("Service Worker 注册失败:", error);
          });
      }
    </script>
    <script
      src="/static/browserfs12/browserfs.min.js"
      type="text/javascript"
    ></script>
    <script>
      (window.process = BrowserFS.BFSRequire("process")),
        (window.Buffer = BrowserFS.BFSRequire("buffer").Buffer);
    </script>
  </head>

    <div id="csb-loading-screen"></div>

      src="/static/js/vendors~sandbox.e7487074d.chunk.js"
